import React from 'react';
import {
  Card,
  CardContent,
  Typography,
  Grid,
  Box,
  Chip,
  LinearProgress,
  Tooltip
} from '@mui/material';

const TopicBar = ({ topic, percentage }) => (
  <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
    <Typography variant="body2" sx={{ minWidth: 100 }}>
      {topic}
    </Typography>
    <Box sx={{ width: '100%', ml: 1 }}>
      <LinearProgress
        variant="determinate"
        value={percentage * 100}
        sx={{
          height: 10,
          borderRadius: 5,
          backgroundColor: '#e0e0e0',
          '& .MuiLinearProgress-bar': {
            backgroundColor: '#1976d2',
            borderRadius: 5,
          },
        }}
      />
    </Box>
    <Typography variant="body2" sx={{ minWidth: 50, ml: 1 }}>
      {Math.round(percentage * 100)}%
    </Typography>
  </Box>
);

const MediaCard = ({ media, stats }) => {
  const getPoliticalBiasColor = (bias) => {
    const value = (bias + 1) / 2; // Convert from [-1,1] to [0,1]
    const hue = value * 240; // 240 for blue (left) to 0 for red (right)
    return `hsl(${hue}, 80%, 70%)`;
  };

  return (
    <Card sx={{ height: '100%' }}>
      <CardContent>
        <Typography variant="h6" gutterBottom>
          {media}
        </Typography>

        <Typography variant="body2" color="text.secondary" gutterBottom>
          {stats.description}
        </Typography>

        <Box sx={{ mt: 2, mb: 2 }}>
          <Chip
            label={stats.category}
            size="small"
            sx={{ mr: 1, mb: 1 }}
          />
        </Box>

        <Typography variant="subtitle2" gutterBottom>
          Politisk orientering
        </Typography>
        <Tooltip title={`Score: ${stats.political_bias}`}>
          <Box
            sx={{
              height: 20,
              width: '100%',
              backgroundColor: getPoliticalBiasColor(stats.political_bias),
              borderRadius: 1,
              mb: 2
            }}
          />
        </Tooltip>

        <Grid container spacing={2} sx={{ mb: 2 }}>
          <Grid item xs={6}>
            <Typography variant="subtitle2" gutterBottom>
              PÃ¥lidelighed
            </Typography>
            <Typography variant="h6">
              {Math.round(stats.reliability_score * 100)}%
            </Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle2" gutterBottom>
              Kildediversitet
            </Typography>
            <Typography variant="h6">
              {Math.round(stats.source_diversity * 100)}%
            </Typography>
          </Grid>
        </Grid>

        <Typography variant="subtitle2" gutterBottom>
          Emnefordeling
        </Typography>
        {Object.entries(stats.topic_coverage).map(([topic, percentage]) => (
          <TopicBar key={topic} topic={topic} percentage={percentage} />
        ))}
      </CardContent>
    </Card>
  );
};

const MediaOverview = ({ mediaStats }) => {
  return (
    <Grid container spacing={3}>
      {Object.entries(mediaStats).map(([media, stats]) => (
        <Grid item xs={12} sm={6} md={4} key={media}>
          <MediaCard media={media} stats={stats} />
        </Grid>
      ))}
    </Grid>
  );
};

export default MediaOverview;
